// frontend/src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import { CartProvider } from './context/CartContext';

// Pages
import LandingPage from './pages/LandingPage';
import Login from './pages/Login';
import SignUp from './pages/SignUp';
import Dashboard from './pages/Dashboard';
import RestaurantListing from './pages/RestaurantListing';
import RestaurantDetail from './pages/RestaurantDetail';
import Cart from './components/Cart';
import Checkout from './pages/Checkout';
import NotFound from './pages/NotFound';

// Components
import ProtectedRoute from './components/ProtectedRoute';
import Navbar from './components/Navbar';
import RestaurantNavbar from './components/RestaurantNavbar';
import Footer from './components/Footer';

// Import existing components

import RestaurantDashboard from './pages/restaurant/RestaurantDashboard';

// Create placeholder components for missing components
const OrderConfirmation = () => (
  <div className="order-confirmation-container">
    <h1>Order Confirmation</h1>
    <p>Your order has been confirmed. Thank you for your purchase!</p>
  </div>
);

const OrderProcessing = () => (
  <div className="order-processing-container">
    <h1>Order Processing</h1>
    <p>Process your restaurant orders here.</p>
  </div>
);

const RestaurantSettings = () => (
  <div className="restaurant-settings-container">
    <h1>Restaurant Settings</h1>
    <p>Configure your restaurant settings here.</p>
  </div>
);

function App() {
  return (
    <AuthProvider>
      <CartProvider>
        <Router>
          <div className="app">
            <Routes>
              {/* Public routes */}
              <Route path="/" element={<LandingPage />} />
              <Route path="/login" element={<Login />} />
              <Route path="/signup" element={<SignUp />} />

              {/* Protected Dashboard route for customers */}
              <Route
                path="/dashboard"
                element={
                  <ProtectedRoute requiredRole="CUSTOMER">
                    <Navbar />
                    <Dashboard />
                    <Footer />
                  </ProtectedRoute>
                }
              />

              {/* Restaurant Owner Routes */}
              <Route
                path="/restaurant/dashboard"
                element={
                  <ProtectedRoute requiredRole="RESTAURANT_STAFF">
                    <RestaurantNavbar />
                    <RestaurantDashboard />
                    <Footer />
                  </ProtectedRoute>
                }
              />

              <Route
                path="/restaurant/orders"
                element={
                  <ProtectedRoute requiredRole="RESTAURANT_STAFF">
                    <RestaurantNavbar />
                    <OrderProcessing />
                    <Footer />
                  </ProtectedRoute>
                }
              />
              <Route
                path="/restaurant/settings"
                element={
                  <ProtectedRoute requiredRole="RESTAURANT_STAFF">
                    <RestaurantNavbar />
                    <RestaurantSettings />
                    <Footer />
                  </ProtectedRoute>
                }
              />

              {/* Other routes */}
              <Route
                path="/restaurants"
                element={
                  <ProtectedRoute>
                    <Navbar />
                    <RestaurantListing />
                    <Footer />
                  </ProtectedRoute>
                }
              />

              <Route
                path="/restaurants/:id"
                element={
                  <ProtectedRoute>
                    <Navbar />
                    <RestaurantDetail />
                    <Footer />
                  </ProtectedRoute>
                }
              />

              <Route
                path="/cart"
                element={
                  <ProtectedRoute>
                    <Navbar />
                    <Cart />
                    <Footer />
                  </ProtectedRoute>
                }
              />

              <Route
                path="/checkout"
                element={
                  <ProtectedRoute>
                    <Navbar />
                    <Checkout />
                    <Footer />
                  </ProtectedRoute>
                }
              />

              <Route
                path="/order-confirmation"
                element={
                  <ProtectedRoute>
                    <Navbar />
                    <OrderConfirmation />
                    <Footer />
                  </ProtectedRoute>
                }
              />

              {/* 404 route */}
              <Route path="*" element={<NotFound />} />
            </Routes>
          </div>
        </Router>
      </CartProvider>
    </AuthProvider>
  );
}

export default App;
